-- 1 : sp_LoginTeacher
IF OBJECT_ID('dbo.sp_LoginTeacher', 'P') IS NOT NULL
    DROP PROCEDURE dbo.sp_LoginTeacher;
GO
CREATE PROCEDURE dbo.sp_LoginTeacher
    @username NVARCHAR(256)
AS
BEGIN
    SET NOCOUNT ON;
    SELECT
        id_teacher,
        full_name,
        username,
        user_role,
        password_hash,
        is_active,
        IsManualDeactivated
    FROM dbo.teachers
